* {
  /* inkluderar border och padding i bredden */
  box-sizing: border-box; }

body {
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  font-family: "Trebuchet MS", Helvetica, sans-serif;
  color: #262626; }

.searchButton, .next {
  background-color: white;
  padding: 0.4rem 1rem;
  margin: 0.8rem 0rem;
  border-radius: 6px; }

.giveMeMooore {
  padding: 1rem; }

h1 {
  color: white; }

.header {
  background-image: url(https://images.pexels.com/photos/5865/healthy-spring-young-green-5865.jpg?cs=srgb&dl=blade-blooming-blossom-5865.jpg&fm=jpg);
  background-size: cover;
  width: 100%;
  margin-top: 1rem;
  padding: 1rem;
  border-radius: 6px;
  box-shadow: 2px 2px 20px darkgreen; }

.form {
  flex-flow: row; }

input {
  margin: 0.6rem; }

.container {
  width: 80%;
  padding: 0;
  margin: 0; }

p, a {
  margin: 0.3rem; }

.card {
  flex: 0 0 80%;
  background-color: #c8fbb0;
  margin: 1rem 0rem;
  padding: 0.5rem 2rem;
  border-radius: 6px;
  box-shadow: 2px 2px 20px darkgrey; }

.hide {
  display: none; }

.popUp {
  display: none;
  z-index: 1;
  overflow: auto;
  width: 100%;
  height: 100%; }
